  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Elderly persons (aged 65 years and older)
  are at increased risk of complications from influenza, with the majority of influenza-related
  hospitalizations and deaths occurring among the elderly (Fiore et al., 2010). Most
  physicians recommend their elderly patients get a flu shot each year, and many hospitals
  inquire about elderly patients immunization status upon admission, providing a vaccination
  if requested.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
